import React from 'react'
import { View, StyleSheet, Image, Text, Button } from 'react-native'
// import ImageButton from 'library/components/ImageButton'

export default class TopicGraph extends React.Component {
  render() {
    return (
      <View style={styles.container}>
        <Image
          style={styles.image}
          source={"images.placeholder"} />
        <Text style={styles.heading}>{"SAdf"}</Text>
        <Text style={styles.text}>{"sadf"}</Text>
        <Text style={styles.text}>{"strings.onboarding.welcome.text2"}</Text>
        <View style={styles.bottom}>
          <Button
            style={styles.button}
            title={"strings.onboarding.welcome.button"} />
        </View>
      </View>
    )
  }
}const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center'
  },
  image: {
    marginTop: 50
  },
  heading: {
    ...palette.heading, ...{
      marginTop: 40
    }
  },
  text: {
    ...palette.text, ...{
      marginHorizontal: 8,
      marginVertical: 10
    }
  },
  bottom: {
    flex: 1,
    justifyContent: 'flex-end',
    marginBottom: 36
  }
})
